import React, {useState, useEffect} from "react";
import ClipLoader from "react-spinners/ClipLoader";
import logo from "../assets/logo-svg-taurania.svg";
import "./Spinner.css";
import Home from "./Home";

function Spinner() {
    const [loading, setLoading] = useState(false);
    useEffect(() =>{
         setLoading(true)
         setTimeout(()=>{
           setLoading(false)
         }, 5000)
    }, [])
  return (
    <div className="spinner">
    {
        loading?
        <ClipLoader
        color={'#36d7b7'}
        loading={loading}
        size={150}
      />:
      <Home></Home>

    }
    </div>
  );
}

export default Spinner;
